import React from "react";
import DistancSlider from "./DistanceSlider";
import PriceSlider from "./PriceSlider";
import RatingsSlider from "./RatingsSlider";
import faker from "faker";
import Card from "../cardDetails/Cards";
import BloodGroup from "./BloodGroupDropDown";
import CitiesDropDown from "./CitiesDropdown";
import Grid from "@material-ui/core/Grid";
import { makeStyles } from "@material-ui/core/styles";

class CardPage extends React.Component {
  constructor(props) {
    console.log("bas ek bar call hona hai tujhe");
    super(props);
  }

  jain = {
    actual: null,
    array: [
      <Card
        imgsrc={faker.image.avatar()}
        distance={20}
        ratings="4"
        link=""
        actual={this.props.distance}
      />,
      <Card
        imgsrc={faker.image.avatar()}
        distance={30}
        ratings="4"
        link=""
        actual={this.props.distance}
      />,
      <Card
        imgsrc={faker.image.avatar()}
        distance={40}
        ratings="4"
        link=""
        actual={this.props.distance}
      />,
      <Card
        imgsrc={faker.image.avatar()}
        distance={50}
        ratings="3"
        link=""
        actual={this.props.distance}
      />,
      <Card
        imgsrc={faker.image.avatar()}
        distance={60}
        ratings="4"
        link=""
        actual={this.props.distance}
      />,
      <Card
        imgsrc={faker.image.avatar()}
        distance={90}
        ratings="4"
        link=""
        actual={this.props.distance}
      />,
      <Card
        imgsrc={faker.image.avatar()}
        distance={100}
        ratings="4"
        link=""
        actual={this.props.distance}
      />,
    ],
  };
  useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
      marginLeft: "10px",
      marginRight: "10px",
      marginTop: "20px",
    },
    paper: {
      padding: theme.spacing(2),
      textAlign: "center",
      color: theme.palette.text.secondary,
    },
  }));

  checkvalue1 = (v) => {
    console.log(v);
  };
  classes = this.useStyles();
  render() {
    return (
      <div>
        <div

          style={{
            padding: "50px",
            borderRadius: "25px",
            backgroundColor: "#F1F1F1",
          }}
        >
          <Grid container spacing={3}>
            <Grid item xs={4}>
              <DistancSlider checkvalue={2} />
            </Grid>
            <Grid item xs={4}>
              <PriceSlider />
            </Grid>
            <Grid item xs={4}>
              <RatingsSlider />
            </Grid>
            <Grid item xs={4}>
              <CitiesDropDown />
            </Grid>
            <Grid item xs={4}>
              <BloodGroup />
            </Grid>
          </Grid>
          {/* {this.jain.array.map((items, index) => {
          return this.jain.array[5].props.actual >=
            this.jain.array[index].props.distance
            ? this.jain.array[index]
            : null;
        })} */}
        </div>
      </div>
    );
  }
}

export default CardPage;
